jQuery(document).ready(function(){jQuery(document).on("click","#enable_cpbwc",function(){if(1!=confirm("Do you really want to Enable/ Disble the feature?"))return!1;jQuery("#publish").click()}),jQuery(document).on("click",".cpbwc-upload-images",function(e){e.preventDefault();var a=jQuery(this),t=jQuery(a).data("name"),i=wp.media({title:"Upload Image",multiple:!0}).open().on("select",function(e){var n,c=i.state().get("selection").map(function(e){return e.toJSON(),e});for(n=0;n<c.length;++n)jQuery(a).after(`<div class="cpbwc-images-wrap image-${c[n].id}">\n                            <img src="${c[n].attributes.url}" width="50px" height="50px" class="cpbwc-images-preview" />\n                            <input class="cpbwc-upload-images${c[n].id}" type="hidden" name="cpbwc_uploaded_product_${t}[]"  value="${c[n].id}">\n                            <ul class='actions'>\n                                <li>\n                                    <a href='#' class='remove' data-id='${c[n].id}' data-name='${t}' title='Remove image'>Remove</a>\n                                </li>\n                            </ul>\n                        </div>`)})}),jQuery(document).on("click",".cpbwc-images-wrap .remove",function(e){e.preventDefault();var a=jQuery(this).data("id");jQuery(this).data("name");jQuery(`.image-${a}`).remove()}),jQuery(document).on("click",".cpbwc-zoom img",function(e){var a=jQuery(this).attr("src");window.open(a,"_blank")})});